import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Logo from "./logo.png";
import "./App.css";

function Navbar() {
  return (
    <nav className="Navbar">
      <Logo />
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/channels">Channels</Link>
        </li>
        <li>
          <Link to="/videos">Videos</Link>
        </li>
      </ul>
    </nav>
  );
}

function Home() {
  return (
    <div className="Home">
      <h1>Welcome to the YouTube Content Analyzer</h1>
      <p>
        Analyze trends, track performance, and optimize your content strategy
        with actionable insights.
      </p>
      <Link to="/get-started" className="btn-primary">
        Get Started
      </Link>
    </div>
  );
}

function App() {
  return (
    <Router>
      <div className="App">
        <header>
          <Navbar />
        </header>
        <main>
          <Routes>
            <Route path="/home" element={<Home />} />
            <Route path="/channels" element={<div>Channels Page</div>} />
            <Route path="/videos" element={<div>Videos Page</div>} />
            <Route path="/get-started" element={<div>Get Started Page</div>} />
            <Route path="/" element={<Home />} />
          </Routes>
        </main>
        <footer>
          <p>&copy; 2025 YouTube Analyzer. All rights reserved.</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
